console.log("⚡ Using Axios in VaultViewer");

import React, { useState } from "react";
import axios from "axios";
console.log("⚡ Using Axios in VaultViewer");


function VaultForm() {
  const [address, setAddress] = useState("");
  const [password, setPassword] = useState("");
  const [data, setData] = useState("");
  const [zkHash, setZkHash] = useState("");
  const [message, setMessage] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post("http://localhost:3001/api/vault/create", {
        address,
        password,
        data,
        zkHash
      });
      setMessage("✅ Vault created: " + res.data.ipfsHash);
    } catch (err) {
      setMessage("❌ Error: " + (err.response?.data?.error || err.message));
    }
  };

  return (
    <div>
      <h2>Create Vault</h2>
      <form onSubmit={handleSubmit}>
        <input placeholder="Wallet Address" value={address} onChange={(e) => setAddress(e.target.value)} required />
        <input placeholder="Master Password" value={password} onChange={(e) => setPassword(e.target.value)} type="password" required />
        <textarea placeholder="Vault Data" value={data} onChange={(e) => setData(e.target.value)} required />
        <input placeholder="ZK Hash (optional)" value={zkHash} onChange={(e) => setZkHash(e.target.value)} />
        <button type="submit">Encrypt & Store</button>
      </form>
      <p>{message}</p>
    </div>
  );
}

export default VaultForm;
